import React, { useState } from "react";
import { Button, Popover } from "@mui/material";
import InterestsIcon from "@mui/icons-material/Interests";

const ShapesMenu = () => {
  const [anchorEl, setAnchorEl] = useState(null);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const handleShapeClick = (shape) => {
    console.log("Selected shape:", shape);
    handleClose();
  };

  return (
    <div>
      <Button
        variant="contained"
        color="primary"
        onClick={handleClick}
        sx={{
          position: "relative",
          left: "63px",
          borderRadius: "50%",
          width: "50px",
          height: "50px",
          margin: "2px"}}
      >
        <InterestsIcon />
      </Button>
      <Popover
        open={Boolean(anchorEl)}
        anchorEl={anchorEl}
        onClose={handleClose}
        anchorOrigin={{
          vertical: "bottom",
          horizontal: "center",
        }}
        transformOrigin={{
          vertical: "top",
          horizontal: "center",
        }}
      ></Popover>
    </div>
  );
};

export default ShapesMenu;
